schemaDefinition: "create or replace view SALES_CHANNEL_QUOTA(\n\t\"GblQuotaValue\"\
  ,\n\t\"GblQuotaSourcedValue\",\n\t\"GblQuotaQuarter\",\n\t\"GblQuotaTerritoryType\"\
  ,\n\t\"GblQuotaTerritoryName\",\n\t\"GblQuotaCountry\",\n\t\"GblQuotaRegion\",\n\
  \t\"GblQuotaArea\",\n\t\"GblQuotaGeo\",\n\t\"GblQuotaTerritorySysID\",\n\t\"GblQuotaDistrict\"\
  \n) as -- SEMANTIC LAYER BEGINS\n\nSELECT \"QUOTA\" as \"GblQuotaValue\",\n    \
  \   \"SOURCEDQUOTA\" as \"GblQuotaSourcedValue\",\n       \"QUARTER\" as \"GblQuotaQuarter\"\
  ,\n       \"TERRITORYTYPE\" as \"GblQuotaTerritoryType\",\n       \"TERRITORYNAME\"\
  \ as \"GblQuotaTerritoryName\",\n       \"COUNTRY\" as \"GblQuotaCountry\",\n  \
  \     \"REGION\" as \"GblQuotaRegion\",\n       \"AREA\" as \"GblQuotaArea\",\n\
  \       \"GEO\" as \"GblQuotaGeo\",\n       \"TERRITORYSYSID\" as \"GblQuotaTerritorySysID\"\
  ,\n       \"DISTRICT\" as \"GblQuotaDistrict\"\nFROM\n  (SELECT \"TERRITORYSYSID\"\
  \ as \"TERRITORYSYSID\",\n          \"GEO\" as \"GEO\",\n          \"AREA\" as \"\
  AREA\",\n          \"REGION\" as \"REGION\",\n          \"COUNTRY\" as \"COUNTRY\"\
  ,\n          \"TERRITORYNAME\" as \"TERRITORYNAME\",\n          \"TERRITORYTYPE\"\
  \ as \"TERRITORYTYPE\",\n          \"QUARTER\" as \"QUARTER\",\n          \"QUOTA\"\
  \ as \"QUOTA\",\n          \"DISTRICT\" as \"DISTRICT\",\n          \"SOURCEDQUOTA\"\
  \ as \"SOURCEDQUOTA\"\n   FROM \"RDS\".\"SURF\".\"TBLCHANNELQUOTA\" where \"TERRITORYTYPE\"\
  !='random')Projection_2;"
